import Link from 'next/link';

const Header = () => (
<ul class="flex">
  <li class="flex-1 mr-2">
  <Link href="/">
    <a class="block py-2 px-4 text-gray-400 cursor-not-allowed" href="#">Home</a>
    </Link>  </li>
  <li class="text-center flex-1">
  <Link href="/about">
    <a class="block py-2 px-4 text-gray-400 cursor-not-allowed" href="#">About</a>
    </Link>
  </li>
</ul>
);

export default Header;
